var l43 = {
    code: 'kk',
    week: {
        dow: 1,
        doy: 7, // The week that contains Jan 1st is the first week of the year.
    },
    buttonText: {
        prev: 'Алдыңғы',
        next: 'Келесі',
        today: 'Бүгін',
        year: 'Жыл',
        month: 'Ай',
        week: 'Апта',
        day: 'Күн',
        list: 'Күн тәртібі',
    },
    weekText: 'Не',
    allDayText: 'Күні бойы',
    moreLinkText(n) {
        return '+ тағы ' + n;
    },
    noEventsText: 'Көрсету үшін оқиғалар жоқ',
};

export { l43 as default };
